1354	248320398238_10151771718773239	April is National Volunteer Recognition Month and we continue to honor many of our amazing volunteers.\n\nToday we honor Lou Ann Mann, from Carrier.  Every organization that utilizes volunteers has people that they know they can count on no matter what the situation.  Lou Ann Mann is one of those people.  \n\nLou Ann Mann has organized volunteers from Carrier for Distribution Day, Christmas Bureau Registration, Drop Off Day, Turn Around Jumpers, Bell Ringing and any other events that The Salvation Army puts on.   She has also led Carrier to the Golden Kettle Award the last two years, which is an award for an organization that has the most volunteer bell ringing hours.\n\nOver the years Lou Ann has proven to be one of the most reliable volunteers that any organization could ever ask for.\n\nToday we salute you, Lou Ann Mann, for your hard work and dedication.	8	2014-04-07 12:35:01	2015-12-22 14:20:36.446478	2015-12-22 14:20:36.446478	5	\N
1355	248320398238_10151765991693239	April is National Volunteer Recognition Month and we continue to honor many of our amazing volunteers.\n\nToday we honor CrossFit Syracuse and its owners, Ellen Goldberg, Dan Goldberg, Rob Burke and Colin Hillman.  These local business owners decided that they wanted to make a difference in the lives of youth in our community, which gave birth to their 2013 "Beat The Streets" benefit event for The Salvation Army's Barnabas Center, which keeps local youth off the streets and out of harms way. After months of planning and marketing, "Beat The Streets" was an amazing success, raising an astonishing $5,005 for Barnabas Center. These funds helped to provide more beds for homeless youth, as well as an upgrade for the basketball court and hoops.\n\nIn addition to raising funds, the owners of Crossfit Syracuse have also taken the time to hang out with the young people served by Barnabas Center, including attending  the center's Christmas Party. They have also committed to do the event again this year, and they have donated their time to other Salvation Army events throughout the year.\n\nWe salute you, Ellen, Dan, Rob and Colin, for your hard work and dedication to this community.	8	2014-04-04 13:00:05	2015-12-22 14:20:36.917101	2015-12-22 14:20:36.917101	7	\N
