1758	248320398238_10151340123223239	A Disaster Assessment Team was dispatched by The Salvation Army to Dingxi City in the Gansu Province of China following an earthquake which struck in the morning of 23 July. The tremors had a magnitude of 6.6 on the Richter scale, causing significant damage to infrastructure and leaving many people homeless. State media reports that at least 75 people were killed and 450 injured, with scores still unaccounted for. \n\nMeeting local officials on arrival, the team from The Salvation Army’s Hong Kong and Macau Command were escorted directly to one of the worst-affected areas – the Ma Jia Ko village of Mai Chun township. The immediate response included a comprehensive needs assessment for the survivors and a visit to patients in a local hospital who had been injured by the quake. \n\nAfter a full evaluation of the longer-term requirements, the team will return to Hong Kong next week and submit a proposal to the government for funding to assist the survivors in the next phase of recovery. \n\nPhotos of the relief efforts can be viewed at http://sar.my/dingxipics	8	2013-07-29 17:08:53	2015-12-22 14:23:35.320108	2015-12-22 14:23:35.320108	4	\N
